import React, { useEffect, useState } from 'react';
import { Box, Grid } from '@mui/material';
import TopBar from '../components/TopBar';
import MapView from '../components/MapView';
import TelemetryPanel from '../components/TelemetryPanel';
import { subscribeToTelemetry } from '../api/socket';

const Home = () => {
  const [telemetry, setTelemetry] = useState(null);

  useEffect(() => {
    const unsubscribe = subscribeToTelemetry((incoming) => {
      console.log('ðŸ“¡ Received telemetry:', incoming);
      setTelemetry(incoming);
    });
    return () => unsubscribe();
  }, []);

  return (
    <Box sx={{ backgroundColor: '#0f172a', height: '100vh', overflow: 'hidden' }}>
      <TopBar telemetry={telemetry} />
      <Grid container spacing={0} sx={{ height: 'calc(100vh - 64px)' }}>
        {/* Telemetry Panel - Left side */}
        <Grid item xs={12} md={4}>
          <Box sx={{ height: '100%', p: 2, overflowY: 'auto' }}>
            <TelemetryPanel telemetry={telemetry} />
          </Box>
        </Grid>

        {/* MapView - Right side */}
        <Grid item xs={12} md={8}>
          <Box sx={{ height: '100%', p: 2 }}>
            <MapView telemetry={telemetry} />
          </Box>
        </Grid>
      </Grid>
    </Box>
  );
};

export default Home;
